import Email from "../../Components/inputREG/Email";
import './Registration.scss'

export const Reg = () => {
    return (
        <div className="blockLogin">
            <form>
                <div className="inBlock">
                    <Email/>
                    <Email/>
                    <Email/>
                </div>
            </form>
        </div>
    )
}

export default Reg;
